import React from "react";
import { Button } from 'reactstrap';

function SignleReport({state}, {type}, {message}, {id}) {
    return <div className="container">
        <ul>
            <li>hello</li>
        </ul>
         <p className="lead">
            <Button color="primary">Resolve</Button>
        </p>
        <p className="lead">
            <Button color="danger">Block</Button>
        </p>

    </div>
}

export default SignleReport;
